  array('id' => '23955','lang' => 'pk','lang_key' => '1. Download the skeleton file and fill it with data.','lang_value' => '1. کنکال فائل ڈاؤن لوڈ کریں اور ڈیٹا سے پُر کریں۔','created_at' => '2021-02-09 14:09:24','updated_at' => '2021-02-09 14:09:24'),
  array('id' => '23956','lang' => 'pk','lang_key' => '2. You can download the example file to understand how the data must be filled.','lang_value' => '2. آپ یہ سمجھنے کے لئے مثال کے طور پر فائل ڈاؤن لوڈ کرسکتے ہیں کہ اعداد و شمار کو کس طرح پر کرنا چاہئے۔','created_at' => '2021-02-09 14:09:24','updated_at' => '2021-02-09 14:09:24'),
  array('id' => '23957','lang' => 'pk','lang_key' => '3. Once you have downloaded and filled the skeleton file, upload it in the form below and submit.','lang_value' => 'ایک بار جب آپ نے کنکال کی فائل کو ڈاؤن لوڈ اور بھر لیا ہے تو ، اسے نیچے دیئے گئے فارم میں اپ لوڈ کریں اور جمع کرائیں۔','created_at' => '2021-02-09 14:09:24','updated_at' => '2021-02-09 14:09:24'),
  array('id' => '23958','lang' => 'pk','lang_key' => '4. After uploading products you need to edit them and set products images and choices.','lang_value' => '4. مصنوعات اپ لوڈ کرنے کے بعد آپ کو ان میں ترمیم کرنے اور مصنوعات کی تصاویر اور انتخاب کو ترتیب دینے کی ضرورت ہوتی ہے۔','created_at' => '2021-02-09 14:09:24','updated_at' => '2021-02-09 14:09:24'),
